private void logFirstSinglelineLine(int startHeaderLine, int headerSize) {
    for (int lineNum = startHeaderLine; lineNum < headerSize; lineNum++) {
        if (!isMultiLine(lineNum)) {
            log(1, MSG_HEADER_MISSING);
            break;
        }
    }
}
